import React, { Component } from 'react';
import './Book_List.css';
import axios from 'axios';
import { useNavigate } from 'reac'

class BookList extends Component {
  constructor(props) {
    super(props);
    this.state = {
      books: [],
      error: null,
      loading: true,
    };
    this.navigate = useNavigate();
  }

  componentDidMount() {
    this.fetchBooks();
  }

  fetchBooks = async () => {
    try {
      const response = await axios.get('http://localhost:5000/books');
      this.setState({ books: response.data, loading: false });
    } catch (error) {
      this.setState({ error: error.message, loading: false });
    }
  };

  deleteBook = async (id) => {
    if (window.confirm("Are you sure you want to delete this book?")) {
      try {
        const response = await axios.delete(`http://localhost:5000/books/${id}`);
        // Check if the response was successful
        if (response.status === 200) {
          // Remove the deleted book from state
          alert("Book Deleted Successfully")
          this.setState((prevState) => ({
            books: prevState.books.filter(book => book.id !== id) // Ensure 'id' matches your data
          }));
        } else {
          throw new Error('Failed to delete the book');
        }
      } catch (error) {
        this.setState({ error: error.message });
      }
    }
  };

  viewBook = (id) => {
    // Use navigate to go to the book details page with a query parameter
    this.navigate(`/books/detail?id=${id}`);
  };
  

  render() {
    const { books, error, loading } = this.state;

    return (
      <div className="container">
        <div className="row mt-5">
          <div className="col-12">
            <div className="card">
              <div className="card-header d-flex justify-content-between align-items-center">
                <h4 className="mb-0">Book Details</h4>
                <button className="btn btn-md btn-info rounded">Add Book</button>
              </div>
              <div className="card-body">
                {loading && <p className="text-center">Loading...</p>}
                <div className="table-responsive" id="proTeamScroll" tabIndex="2">
                  <table className="table table-striped text-center">
                    <thead>
                      <tr>
                        <th>Cust.</th>
                        <th>Book Title</th>
                        <th>Book Author</th>
                        <th>Edit</th>
                      </tr>
                    </thead>
                    <tbody>
                      {error && (
                        <tr>
                          <td colSpan="4" className="text-danger text-center">{error}</td>
                        </tr>
                      )}
                      {books.length === 0 && !error && (
                        <tr>
                          <td colSpan="4" className="text-center">No books available</td>
                        </tr>
                      )}
                      {books.map((book, index) => (
                        <tr key={book.bookId}>
                          <td>{index + 1}</td>
                          <td>{book.bookTitle}</td>
                          <td>{book.bookAuthor}</td>
                          <td>
                            <button className="btn btn-sm btn-success rounded" onClick={() => this.viewBook(book.id)}>View Detail</button>&nbsp;
                            <button className="btn btn-sm btn-primary rounded ">Update</button>&nbsp;
                            <button className="btn btn-sm btn-danger rounded-custom" onClick={() => this.deleteBook(book.id)}>Delete</button>
                          </td>
                        </tr>
                      ))}
                    </tbody>
                  </table>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default BookList;
